import React, { useState } from 'react';
import './MiscContent.css';

const MiscContnet = () => {
  const pages = [<iframe title="important message" src="https://www.youtube.com/embed/dQw4w9WgXcQ" frameborder="0" allow="accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture" allowfullscreen></iframe>];

  const [page, setPage] = useState(0);



  return  (
    <div className='MiscContent'>
      {pages[page]}
    </div>
  );
}
export default MiscContnet;
